import React from 'react';
import './style.css'

const Table = ({ data, header }) => {



    return (
        <div>
            <table>
                <tr>
                    {header.map((title, index) => (
                        <th key={index}>{title}</th>
                    ))}
                </tr>
                {data.map((item, idex) =>
                    <tr key={idex}>
                        <td>{item.name}</td>
                        <td>{item.phone}</td>
                        <td>{item.email}</td>
                    </tr>
                )}
            </table>
        </div>
    );
}

export default Table;
